data.text:
@kaitlancollins Oh, we'll see him alright.

Rage tweeting all night and claiming states he clearly hasn't won. Twitter needs to suspend his account for 36 hours for repeated TOS violations.

They'd do it to any of us without blinking.

Do not go gentle into that toxic sewer,
Old age should burn and rave at close of day;
Rage, rage against the dying of the scam.

@realDonaldTrump
